import "./App.css";
import {
  BrowserRouter as Router,
  Route,
  Switch,
  Routes,
  Link,
} from "react-router-dom";
import Home from "./pages/home";

function App() {
  return (
    <div className="App">
      <Link to="/createpost"> Create A Post</Link>
      <Router>
        <Routes>
          <Route path="/" exact Component={Home} />
          <Route path="/createpost" exact Component={Home} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
